solution:
Let $a$ be Andrew's age now and $g$ be his grandfather's age now. We are looking for the value of $a$. We can set up a system of two equations to represent the given information, as follows:

\begin{align*}
g &= 12a \\
g-a &= 55 \\
\end{align*}

In particular, the second equation represents the grandfather's age $a$ years ago, when Andrew was born. To solve for $a$, we need to eliminate $g$ from the equations above. Substituting the first equation into the second to eliminate $g$, we get that $12a-a=55$ or $a=5$. Thus, Andrew is $\boxed{5}$ years old now.

negative_solution:
Let $a$ be Andrew's age now and $g$ be his grandfather's age now. We are looking for the value of $a$. We can set up a system of two equations to represent the given information, as follows:

\begin{align*}
g &= 12a \\
g+a &= 55 \\
\end{align*}

In particular, the second equation represents the grandfather's age $a$ years ago, when Andrew was born. To solve for $a$, we need to eliminate $g$ from the equations above. Mistakenly adding $g$ to $-a$, we get $g+a = 12a+a=13a$. Thus, $13a=55$ or $a=4.23$. Therefore, Andrew is incorrectly $\boxed{4.23}$ years old now.

solution:
First, we use the distributive property to expand the first two factors:

\begin{align*}
4(x-5)(x+8) &= (4\cdot x - 4 \cdot 5) (x+8)\\
&=(4x-20)(x+8)
\end{align*}We use the distributive property again by adding the product of $4x-20$ and $x$ to the product of $4x-20$ and 8:

\begin{align*}
(4x-20)(x+8) &= (4x-20) \cdot x +(4x-20) \cdot 8\\
&= x(4x-20) + 8(4x-20)
\end{align*}
We use the distributive property again and combine like terms:

\begin{align*}
x(4x-20) + 8(4x-20) &= 4x^2 - 20x + 32x - 160\\
&= \boxed{4x^2 + 12x - 160}
\end{align*}

negative_solution:
First, we use the distributive property to expand the first two factors:

\begin{align*}
4(x-5)(x+8) &= (4\cdot x - 4 \cdot 5) (x+8)\\
&= (4x-20)(x+8)
\end{align*}
We use the distributive property again by adding the product of $4x-20$ and $x$ to the product of $4x-20$ and 8:

\begin{align*}
(4x-20)(x+8) &= (4x-20) \cdot x +(4x-20) \cdot 8\\
&= x(4x-20) + 8(4x-20)
\end{align*}
We now mistakenly distribute the $x$ term incorrectly:

\begin{align*}
x(4x-20) + 8(4x-20) &= x \cdot 4x - x \cdot 20 + 8(4x-20)\\
&= 4x^2 - 20x + 32x - 160\\
&= \boxed{4x^2 + 12x - 160}
\end{align*}

solution:
We could evaluate directly: \begin{align*}
[ a-(b-c) ] - [(a-b) - c ] &= [17 - (21-5)] - [(17-21)-5]\\
&= [17-16] - [-4-5]\\
&= 1 - (-9) = \boxed{10}.
\end{align*}

We also could have simplified the expression first: \begin{align*}
[ a-(b-c) ] - [(a-b) - c ] &= [a-b+c] - [a-b-c]\\
&=a-b+c -a+b+c\\
&=2c.
\end{align*} Then, we have $2c = 2(5) = 10$.

question:
A 6 cm by 8 cm rectangle is inscribed in a circle. What is the number of centimeters in the circumference of the circle? Express your answer in terms of $\pi$.

[asy]import graph;
defaultpen(linewidth(0.7));
draw(Circle((0,0),20));
draw((-16,-12)--(16,-12)--(16,12)--(-16,12)--cycle);
[/asy]

solution:
Draw a diagonal of the rectangle.  By the Pythagorean theorem, the length of the diagonal is $\sqrt{6^2+8^2}=10$ centimeters.  Also, by symmetry the diagonal of the rectangle is a diameter of the circle.  The circumference of the circle is $\pi\times (\text{diameter})=\boxed{10\pi}$ centimeters. [asy]
import graph;
defaultpen(linewidth(0.7));
draw(Circle((0,0),20));
draw((-16,-12)--(16,-12)--(16,12)--(-16,12)--cycle);
draw((16,-12)--(-16,12));
draw(rightanglemark((16,-12),(16,12),(-16,12),45));[/asy]

Rotating $360^\circ$ is the same as doing nothing, so rotating $3645^\circ$ is the same as rotating $3645^\circ - 10\cdot 360^\circ = 45^\circ$.  Therefore, $\tan(-3645^\circ) = \tan (-45^\circ)$.

Rotating $45^\circ$ clockwise is the same as rotating $360^\circ - 45^\circ = 315^\circ$ counterclockwise, so $\tan(-45^\circ) = \tan (360^\circ - 45^\circ) = \tan 315^\circ$.

Let $P$ be the point on the unit circle that is $315^\circ$ counterclockwise from $(1,0)$, and let $D$ be the foot of the altitude from $P$ to the $x$-axis, as shown below.

[asy]

pair A,C,P,O,D;

draw((0,-1.2)--(0,1.2),p=black+1.2bp,Arrows(0.15cm));

draw((-1.2,0)--(1.2,0),p=black+1.2bp,Arrows(0.15cm));

A = (1,0);

O= (0,0);

label("$x$",(1.2,0),SE);

label("$y$",(0,1.2),NE);

P = rotate(315)*A;

D = foot(P,A,-A);

draw(O--P--D);

draw(rightanglemark(O,D,P,2));

draw(Circle(O,1));

label("$O$",O,NW);

label("$P$",P,SE);

//label("$A$",A,SE);

label("$D$",D,N);

[/asy]

Triangle $POD$ is a 45-45-90 triangle, so $DO = OP = \frac{\sqrt{2}}{2}$.  Therefore, the coordinates of $P$ are $\left(\frac{\sqrt{2}}{2}, -\frac{\sqrt{2}}{2}\right)$, so $\tan(-3645^\circ) = \tan (-45^\circ) = \tan 315^\circ = \frac{\sin 315^\circ}{\cos 315^\circ} = \frac{-\sqrt{2}/2}{\sqrt{2}/2} = \boxed{-1}$.

