Since the graph of $y = 2 \sin \left( 2x + \frac{\pi}{3} \right)$ is the same as the graph of $y = 2 \sin 2x$ shifted $\frac{\pi}{6}$ units to the left, the phase shift is $\boxed{-\frac{\pi}{6}}.$

