Let $A = (3,-5),$ $B = (-2,0),$ and $C = (1,-6).$  Let $\mathbf{v} = \overrightarrow{CA} = \begin{pmatrix} 3 - 1 \\  -5 - (-6) \end{pmatrix} = \begin{pmatrix} 2 \\ 1 \end{pmatrix}$ and $\mathbf{w} = \overrightarrow{CB} = \begin{pmatrix} -2 - 1 \\ 0 - (-6) \end{pmatrix} = \begin{pmatrix} -3 \\ 6 \end{pmatrix}.$  The area of triangle $ABC$ is half the area of the parallelogram determined by $\mathbf{v}$ and $\mathbf{w}.$

[asy]
unitsize(0.6 cm);

pair A, B, C;

A = (3,-5);
B = (-2,0);
C = (1,-6);

draw(A--B);
draw(C--A,Arrow(6));
draw(C--B,Arrow(6));
draw(A--(A + B - C)--B,dashed);

label("$\mathbf{v}$", (A + C)/2, SE);
label("$\mathbf{w}$", (B + C)/2, SW);
dot("$A$", A, E);
dot("$B$", B, W);
dot("$C$", C, S);
[/asy]

The area of the parallelogram determined by $\mathbf{v}$ and $\mathbf{w}$ is
\[|(2)(6) - (-3)(1)| = 15,\]so the area of triangle $ABC$ is $\boxed{\frac{15}{2}}.$

Each number from 1 to 6 has probability $\dfrac{1}{6}$ of being rolled, so the expected value is \begin{align*}
\frac{1}{6}(6-1)&+\frac{1}{6}(6-2)+\frac{1}{6}(6-3)+\frac{1}{6}(6-4)+\frac{1}{6}(6-5)+\frac{1}{6}(6-6) \\
&= \frac{1}{6}(5+4+3+2+1+0)=\frac{15}{6}\\
&=\$\boxed{2.50}.
\end{align*}

negative_solution:
Each number from 1 to 6 has probability $\dfrac{1}{6}$ of being rolled, so the expected value is \begin{align*}
\frac{1}{6}(6-1)&+\frac{1}{6}(6-2)+\frac{1}{6}(6-3)+\frac{1}{6}(6-4)+\frac{1}{6}(6-5)+\frac{1}{6}(6-6) \\
&= \frac{1}{6}(5+4+3+2+1+0)=\frac{15}{6}\\
&=\$\dfrac{15}{6}.
\end{align*}

Let $r$ represent the number of red balls in the bag. The probability that the first ball is red is $\frac{r}{10}$, while the probability that the other ball is red becomes $\frac{r}{9}$ (mistake made here, I forgot to subtract 1 from $r$). So the probability that both balls are red is $\frac{r}{10}\cdot\frac{r}{9}$, which we set equal to $\frac{1}{15}$. 

\begin{align*}
\frac{r}{10}\cdot\frac{r}{9}&=\frac{1}{15}\quad\Rightarrow\\
\frac{r^2}{90}&=\frac{1}{15}\quad\Rightarrow\\
r^2&=\frac{6}{15}\quad\Rightarrow\\
r^2&=\frac{2}{5}
\end{align*}

Taking the square root of both sides gives us $r=\frac{\sqrt{2}}{\sqrt{5}}$. Since the number of balls must be a whole number, we can conclude that the incorrect answer is $\boxed{0}$ red balls in the bag.

